Actionscript.script:
onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		_parent.大型武器攻击搓招();
	}
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "蓝色炮击";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 2;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 60;
	子弹属性.击倒率 = 10;

	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "冲";

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	var myPoint = {x:this._x, y:this._y};
	_parent.localToGlobal(myPoint);
	_root.gameworld.globalToLocal(myPoint);
	shootX = myPoint.x;
	shootY = myPoint.y;

	if(_parent._parent.召唤物数量<=0)
	{
		_parent._parent.召唤物数量 = 0;
	}

	var list = ["敌人-普通基因虫","敌人-普通僵尸蛆","敌人-裸体兽化僵尸1","敌人-僵尸1-狗","敌人-boss大僵尸","敌人-骨刺僵尸","敌人-硬化僵尸"];
	var 召唤物 = list[random(list.length)];

	兵种 = 召唤物;
	等级 = _parent._parent.等级;
	名字 = "召唤物";
	是否为敌人 = _parent._parent.是否为敌人;
	随机身高 = 150 + _root.随机整数(150)
	身高 = 随机身高;

	_parent._parent.召唤物数量 += 1;

	长枪 = "";
	手枪 = "";
	手枪2 = "";
	刀 = "";
	手雷 = "";
	召唤物newname = _parent._parent._name + 兵种 + _parent._parent.召唤物数量;
	_root.加载游戏世界人物(兵种,召唤物newname,_root.gameworld.getNextHighestDepth(),{_x:shootX, _y:shootY, 等级:this.等级, 名字:this.名字, 是否为敌人:this.是否为敌人, 身高:this.身高, 长枪:this.长枪, 手枪:this.手枪, 手枪2:this.手枪2, 刀:this.刀, 手雷:this.手雷});
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 10 + 自机.刀属性.power * 1;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 60;
	子弹属性.击倒率 = 10;

	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "电";

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

